import React from 'react';
import './App.css';
import 'semantic-ui-css/semantic.min.css'

import SearchStandard from './Search';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <SearchStandard />
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
